create table plays_as_home
(
    match_id             integer not null
        constraint match_home_team_match_match_id_fk
            references match,
    team_id              integer not null
        constraint match_home_team_team_id_fkey
            references national_team,
    half_time_home_goals integer,
    home_team_goals      integer
);

alter table plays_as_home
    owner to postgres;

